CREATE TABLE SYS_MENU (
  ID NUMBER(18,0) primary key,
  PID NUMBER(18,0),
  TYPE NUMBER(1,0) NOT NULL,
  TITLE VARCHAR2(100) NOT NULL,
  ICON VARCHAR2(50),
  PATH VARCHAR2(100) DEFAULT '',
  TARGET VARCHAR2(100),
  PERMISSION VARCHAR2(80),
  SUB_COUNT NUMBER(8,0),
  SHOW NUMBER(1,0) NOT NULL,
  SORT NUMBER(8,0) DEFAULT '1',
  CREATE_TIME TIMESTAMP,
  CREATE_BY VARCHAR2(64),
  UPDATE_TIME TIMESTAMP,
  UPDATE_BY VARCHAR2(64)
);

COMMENT ON COLUMN SYS_MENU.ID IS '菜单';
COMMENT ON COLUMN SYS_MENU.PID IS '父ID';
COMMENT ON COLUMN SYS_MENU.TYPE IS '菜单类型(1.目录 2.菜单 3.按钮)';
COMMENT ON COLUMN SYS_MENU.TITLE IS '菜单名称';
COMMENT ON COLUMN SYS_MENU.ICON IS '菜单图标';
COMMENT ON COLUMN SYS_MENU.PATH IS '路径(不含context-path 且于/开始)';
COMMENT ON COLUMN SYS_MENU.TARGET IS '_blank.在新窗口中打开 _self.当前框架中打开 _parent.在父框架中打开 _top.在整个窗口中打开 _content.在右侧框架中打开';
COMMENT ON COLUMN SYS_MENU.PERMISSION IS '权限标识(菜单或按钮，具体用于权限管控的对象)';
COMMENT ON COLUMN SYS_MENU.SUB_COUNT IS '子级个数(含隐藏的 show=1)';
COMMENT ON COLUMN SYS_MENU.SHOW IS '是否显示(0:否 1:是)';
COMMENT ON COLUMN SYS_MENU.SORT IS '排序(1开始 越大越靠前)';
COMMENT ON COLUMN SYS_MENU.PID IS '父ID';
COMMENT ON COLUMN SYS_MENU.CREATE_TIME IS '创建时间';
COMMENT ON COLUMN SYS_MENU.CREATE_BY IS '创建人';
COMMENT ON COLUMN SYS_MENU.UPDATE_TIME IS '创建时间';
COMMENT ON COLUMN SYS_MENU.UPDATE_BY IS '创建人';
COMMENT ON TABLE  SYS_MENU IS '系统::新菜单表';






CREATE TABLE SYS_LOG (
  ID numeric(24,0) NOT NULL,
  LOG_TYPE char(2)  NOT NULL,
  LOG_TITLE VARCHAR2(100)  NOT NULL,
  LOG_DATE TIMESTAMP(6) NOT NULL,
  REMOTE_ADDRESS VARCHAR2(30) ,
  LOG_CONTENT VARCHAR2(1024) 
);

COMMENT ON COLUMN SYS_LOG.ID IS '日志表ID';
COMMENT ON COLUMN SYS_LOG.LOG_TYPE IS '1.用户登录 ... 7.电商八填报';
COMMENT ON COLUMN SYS_LOG.LOG_TITLE IS '日志标题';
COMMENT ON COLUMN SYS_LOG.LOG_DATE IS '日志时间';
COMMENT ON COLUMN SYS_LOG.REMOTE_ADDRESS IS '远程地址IP';
COMMENT ON COLUMN SYS_LOG.LOG_CONTENT IS '日志内容';
COMMENT ON TABLE SYS_LOG IS '系统::日志表';


-- 定时任务应用配置
CREATE TABLE SYS_SHEDLOCK_APP (
  APPLICATION VARCHAR2(64) NOT NULL ,
  HOST_IP VARCHAR2(32) not null,
  HOST_NAME VARCHAR2(100),
  STATE CHAR(1) DEFAULT 1,
    LABEL VARCHAR2(50),
  UPDATE_TIME TIMESTAMP(3) NOT NULL,
  PRIMARY KEY (APPLICATION,HOST_IP)
);
COMMENT ON COLUMN SYS_SHEDLOCK_APP.APPLICATION IS '当前实例应用';
COMMENT ON COLUMN SYS_SHEDLOCK_APP.HOST_IP IS '当前实例应用所属IP';
COMMENT ON COLUMN SYS_SHEDLOCK_APP.HOST_NAME IS '创建机器';
COMMENT ON COLUMN SYS_SHEDLOCK_APP.STATE IS '状态 0.关闭 1.开启';
COMMENT ON COLUMN SYS_SHEDLOCK_APP.LABEL IS '备注信息';
COMMENT ON COLUMN SYS_SHEDLOCK_APP.UPDATE_TIME IS '创建时间';
COMMENT ON TABLE  SYS_SHEDLOCK_APP IS '集群分佈式鎖-应用配置';

-- 定时任务锁(new)
CREATE TABLE SYS_SHEDLOCK_JOB (
  APPLICATION VARCHAR2(64) NOT NULL ,
  NAME VARCHAR2(64) not null,
  HOST_IP VARCHAR2(32) not null,
  LOCKED_AT timestamp(6) NOT NULL,
  LOCK_UNTIL timestamp(6) NOT NULL,
  LOCKED_BY VARCHAR2(100) NOT NULL,
  STATE CHAR(1) DEFAULT 1,
  DATA VARCHAR2(256),
  LABEL VARCHAR2(100),
  CALL_TYPE VARCHAR2(20),
  CALL_VALUE VARCHAR2(100),
  UPDATE_TIME TIMESTAMP(3) NOT NULL,
  PRIMARY KEY (APPLICATION, NAME)
);
COMMENT ON COLUMN SYS_SHEDLOCK_JOB.APPLICATION IS '当前实例应用';
COMMENT ON COLUMN SYS_SHEDLOCK_JOB.NAME IS '任務名稱(即ID)';
COMMENT ON COLUMN SYS_SHEDLOCK_JOB.HOST_IP IS '当前实例应用所属IP';
COMMENT ON COLUMN SYS_SHEDLOCK_JOB.LOCKED_AT IS '任務開始鎖定';
COMMENT ON COLUMN SYS_SHEDLOCK_JOB.LOCK_UNTIL IS '任務鎖定至';
COMMENT ON COLUMN SYS_SHEDLOCK_JOB.LOCKED_BY IS '任務執行人';
COMMENT ON COLUMN SYS_SHEDLOCK_JOB.LABEL IS '任務標識';
COMMENT ON COLUMN SYS_SHEDLOCK_JOB.CALL_TYPE IS '定时任务类型';
COMMENT ON COLUMN SYS_SHEDLOCK_JOB.CALL_VALUE IS '定时任务值';
COMMENT ON COLUMN SYS_SHEDLOCK_JOB.STATE IS '0.close关闭 1.open开启(默认) 局部限制标志位(只限制所有相同实例中的此任务)';
COMMENT ON COLUMN SYS_SHEDLOCK_JOB.DATA IS 'job参数';
COMMENT ON COLUMN SYS_SHEDLOCK_JOB.UPDATE_TIME IS '最后更新时间(也即最近一次执行时间/获取锁时间)';
COMMENT ON TABLE  SYS_SHEDLOCK_JOB IS '集群分佈式鎖-任务配置';

CREATE TABLE SYS_FILE (
  ID numeric(24,0) NOT NULL,
  ORIGINAL_NAME VARCHAR2(100)  NOT NULL,
  NAME VARCHAR2(50)  NOT NULL,
  FILE_PATH VARCHAR2(255)  NOT NULL,
  FILE_TYPE VARCHAR2(10)  NOT NULL,
  CATEGORY VARCHAR2(100)  NOT NULL,
  CREATE_TIME timestamp(6) NOT NULL,
  CREATE_BY VARCHAR2(255) 
);
COMMENT ON COLUMN sys_file.id IS '文件表ID';
COMMENT ON COLUMN sys_file.original_name IS '上传文件名称';
COMMENT ON COLUMN sys_file.name IS '保存文件名';
COMMENT ON COLUMN sys_file.file_path IS '文件保存路径';
COMMENT ON COLUMN sys_file.file_type IS '文件类型';
COMMENT ON COLUMN sys_file.category IS '文件分类(手动名称)';
COMMENT ON COLUMN sys_file.create_time IS '创建时间';
COMMENT ON COLUMN sys_file.create_by IS '创建人';
COMMENT ON TABLE sys_file IS '系统::文件表';



CREATE TABLE SYS_DICT (
