CREATE TABLE SYS_USER (
  ID NUMBER(18,0) PRIMARY KEY,
  DEPT_ID NUMBER(18,0),
  USER_NAME VARCHAR2(50) NOT NULL,
  NICK_NAME VARCHAR2(50),
  GENDER VARCHAR2(1),
  PHONE VARCHAR2(22),
  EMAIL VARCHAR2(50) ,
  PASSWORD VARCHAR2(256) NOT NULL,
  REGISTER_DATE timestamp(6) NOT NULL,
  LAST_LOGIN_DATE timestamp(6),
  PWD_RESET_TIME timestamp(6),
  STATUS numeric(1) NOT NULL,
  DEL_FLAG numeric(1) NOT NULL,
  CREATE_TIME timestamp(6) NOT NULL,
  CREATE_BY VARCHAR2(50),
  UPDATE_TIME timestamp(6) NOT NULL,
  UPDATE_BY VARCHAR2(50)
);

COMMENT ON COLUMN SYS_USER.ID IS '表ID/用户ID';
COMMENT ON COLUMN SYS_USER.DEPT_ID IS '部门ID(保留字段暂不使用)';
COMMENT ON COLUMN SYS_USER.USER_NAME IS '用户名称';
COMMENT ON COLUMN SYS_USER.NICK_NAME IS '用户昵称';
COMMENT ON COLUMN SYS_USER.GENDER IS 'M.男 F.女';
COMMENT ON COLUMN SYS_USER.PHONE IS '手机号码';
COMMENT ON COLUMN SYS_USER.EMAIL IS '用户email(可用于登陆)';
COMMENT ON COLUMN SYS_USER.PASSWORD IS '用户密码';
COMMENT ON COLUMN SYS_USER.REGISTER_DATE IS '用户注册时间';
COMMENT ON COLUMN SYS_USER.LAST_LOGIN_DATE IS '最后登录时间';
COMMENT ON COLUMN SYS_USER.PWD_RESET_TIME IS '密码最后重置时间';
COMMENT ON COLUMN SYS_USER.STATUS IS '状态1.启用 0.禁用';
COMMENT ON COLUMN SYS_USER.DEL_FLAG IS '删除标记1.正常 0.删除';
COMMENT ON COLUMN SYS_USER.CREATE_TIME IS '创建时间';
COMMENT ON COLUMN SYS_USER.CREATE_BY IS '创建人';
COMMENT ON COLUMN SYS_USER.UPDATE_TIME IS '创建时间';
COMMENT ON COLUMN SYS_USER.UPDATE_BY IS '创建人';
COMMENT ON TABLE SYS_USER IS '系统::用户信息表';



